import Header from '../components/Header'

function FoodArea() {
  const { setShowButton, setTitle, } = useContext(RecipesContext);

  useHeader('Explorar Origem', false, setShowButton, setTitle)

  return (
    <div>
      <Header/>
      this is food area
      <Footer />
    </div>

  );
}

export default FoodArea;
